import React from "react";

import NIGHT from "../../assets/BOG1.jpg";
import BLUEGRADIENT from "../../assets/BLUE.png";
import GUITAR from "../../assets/Guitar.png"
import Menu from "../Menu/Menu";

export default class Hobbies extends React.Component {
  render() {
    return (
      <div className="ContextContainer">
        <Menu />
        <div style={{ height: "2vh" }}>&nbsp;</div>

        {/* ---------- */}
        {/* CONTENT */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div
            className="BaseCard"
            style={{ backgroundImage: "url(" + NIGHT + ")" }}
            data-uk-parallax="bgy: 150"
          >
            <h1 data-uk-parallax="y: -200; easing: 0.5" id="CardName">
              hobbies
            </h1>
          </div>
        </div>

        {/* ---------- */}
        {/* P01 */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div
            className="BaseCard"
            style={{ backgroundImage: "url(" + BLUEGRADIENT + ")" }}
          >
            <h1
              data-uk-parallax="y: -100; easing: 1"
              id="CardName"
              style={{ left: "-5%" }}
            >
              01
            </h1>
            <img src={GUITAR} alt="Electric Guitar" width="500px" style={{position: 'relative', right: '-30em'}} data-uk-parallax="y: -100; easing: 0"/>
          </div>
        </div>

        {/* ---------- */}
        {/* P02 */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div
            className="BaseCard"
            style={{ backgroundImage: "url(" + BLUEGRADIENT + ")" }}
          >
            <h1
              data-uk-parallax="y: -100; easing: 1"
              id="CardName"
              style={{ left: "-5%" }}
            >
              02 - game dev
            </h1>
          </div>
        </div>

        {/* ---------- */}
        {/* P03 */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div
            className="BaseCard"
            style={{ backgroundImage: "url(" + BLUEGRADIENT + ")" }}
          >
            <h1
              data-uk-parallax="y: -100; easing: 1"
              id="CardName"
              style={{ left: "-5%" }}
            >
              03 - gaming
            </h1>
          </div>
        </div>

        {/* ---------- */}
        {/* P04 */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div
            className="BaseCard"
            style={{ backgroundImage: "url(" + BLUEGRADIENT + ")" }}
          >
            <h1
              data-uk-parallax="y: -100; easing: 1"
              id="CardName"
              style={{ left: "-5%" }}
            >
              03 -languages
            </h1>
          </div>
        </div>

        <div style={{ height: "10vh" }}>&nbsp;</div>
      </div>
    );
  }
}
